    }

    {{#userData}}

        getData();

        $(".dateInput").each(function(i, el){
            if($(el).data('date')){
                var dateTime = setDateTime($(el).data("date"));

                $(el).text(dateTime.date);
            } 
        });

        $(window).on("click", function(){
            if(!$(this).hasClass("table-row")){
                $("#delete-user").removeClass("btn-danger");
                $("#delete-user").addClass("btn-secondary").prop('disabled', true);
                $(".table-row").removeClass("selected");
            }
        });

        $(document).on("click", ".table-row", function(e){
            e.stopPropagation()
            $(".table-row").removeClass("selected");

            $(this).addClass("selected");

            $("#delete-user").removeClass("btn-secondary");
            $("#delete-user").addClass("btn-danger").prop('disabled', false);
        });

        $("#delete-user").on("click", function(){
           var id = $(".table-row.selected").data("id");
            $.ajax({
                url: "/listPatient", 
                type: "DELETE",
                data: {key: "{{key}}", id: id},
                cache: false,
                success: function(res){                          
                    setTimeout(function(){
                        getData();
                    },500);
                },
                error:function(err){
                    getData();
                }
            });
        })

    /************ Functions ****************/
        function getData(){
             var id = $(".table-row.selected").data("id");
            var rows = []
            $.ajax({
                url: "/listpatient/init/all", 
                type: "GET",     
                data: {key: "{{key}}"},
                cache: false,
                success: function(res){   
                    res = JSON.parse(res || "{}");
                    console.log("res", res);

                    if(res.success && res.data.length){
                        res.data.map(function(pt, i){
                            ptData[pt.idPatient] = pt;

                            var dateTime = setDateTime(pt.dateNaissance);

                            var row = $(`<tr class="table-row">
                                <td>${i+1}</td>
                                <td>${pt.nomPatient}</td>
                                <td>${pt.prenomPatient}</td>
                                <td>${pt.emailPatient}</td>
                                <td>${pt.numTel}</td>
                                <td>${pt.sexe}</td>
                                <td>${pt.address}</td>
                                <td>${dateTime.date}</td>
                                <td>${pt.motDePasse}</td>
                            </tr>`);

                            row.data("id", pt.idPatient)

                            if(id == pt.idPatient){
                                row.addClass("selected");
                            }

                            rows.push(row);
                        });
                        $("tbody").html(rows);
                    }else{
                        $("tbody").html(`<tr>
                            <td colspan="7" class="text-center">
                                Aucun Patient pour le moment !!!!  
                            </td>
                        </tr>`)
                    }
                },
                error:function(err){
                    console.log("err", err);
                }
            });
        }
        function resetModal(){
            $("#form-id[ajax=true]").trigger('reset');
            $("#save-medecin").prop("disabled", false);
            $("#form-id[ajax=true]").removeClass("was-validated");
            $("#notification").removeClass("alert-danger").removeClass("alert-success").html("....").hide();
        }
        function setDateTime(val){
            var d = new Date(val);
            var date = d.getFullYear()+ "-" +(d.getMonth()+1>=10?(d.getMonth()+1):"0"+(d.getMonth()+1)+ "-" +(d.getDate()>=10?d.getDate():"0"+d.getDate()));
            var time = (d.getHours()>=10?d.getHours():"0"+d.getHours())+":"+(d.getMinutes()>=10?(d.getMinutes()):"0"+(d.getMinutes()));
            return {date: date,time: time};
        }
    {{/userData}}
});

