        function searchMedoc (str) {
            var regex = new RegExp(str, "i")
            return medocData.filter(function(el, i){

                if(regex.test(el.nomMedoc)){
                    return el;
                }
            })
        }
        function getMedoc(){
            $.ajax({
                url: "/medicaments/init/all", 
                type: "GET",     
                data: {key: "{{key}}"},
