                    res = JSON.parse(res || "{}");
                    console.log("res", res);

                    if(res.success && res.data.length){
                        medocData = res.data;
                    } else {
                        medocData = [];
                    }
                },
                error:function(err){
                    medocData = [];
                    console.log("err", err);
                }
            });
        }

        function getData(){
           var id = $(".table-row.selected").data("id");
            var tbody = [];
            $.ajax({
                url: "/listrdv/init/all", 
                type: "GET",     
                data: {key: "{{key}}"},
                cache: false,
                success: function(res){   
                    res = JSON.parse(res || "{}");

                    console.log("res getData", res);

                    if(res.success && res.data.length){
                        res.data.map(function(rdv, i){

                            rdvData[rdv.idRdv] = rdv;
                            rdvData[rdv.idRdv] = rdv;

                            var dateTime = setDateTime(rdv.dateTime);

                            var row =  $(`<tr class="table-row${rdv.active !== 1?' unactive':""}">
                                <td>${i+1}</td>
                                <td class="dateInput">${dateTime.date}</td>
                                <td class="timeInput">${dateTime.time}</td>
                                <td>${rdv.status}</td>
                                ${rdv.nomPatient? '<td  class="patient">'+rdv.nomPatient+'</td>':""}
                                ${rdv.sexe? '<td  class="patient">'+rdv.sexe+'</td>':""}
                                ${rdv.specialite? '<td class="spc">'+rdv.specialite+'</td>':""}
                                ${rdv.nomMedecin? '<td class="medecin">'+rdv.nomMedecin+'</td>':""}
                            </tr>`);

                            row.data("id", rdv.idRdv);
                            row.data("data", rdv);

                            if(id == rdv.idRdv){
                                row.addClass("selected");
                            }
                            if(filterRdv.length && filterRdv.indexOf(rdv.idRdv) >= 0){
                                row.hide();
                            }
                            switch (rdv.status) {
                                case 'ACCEPTER':
                                    row.addClass("table-success")
                                break;
                                case 'REFUSER':
                                    row.addClass("bg-danger")
                                break;
                                case 'ANNULER':
                                    row.addClass("table-danger")
                                break;
                                case 'ATTENTE':
                                    //row.addClass("table-dark")
                                break;
                            }
                            tbody.push(row);
                        })  

                        $("tbody").html(tbody);
                    } else {
                        $("tbody").html(`<tr>
                            <td colspan="7" class="text-center">Aucun Rendez-vous pour le moment, vous pouver Initer un!!</td>
                        </tr>`);
                    }
                },
                error: function(err){
                    console.log("err", err);
                }
            });
        }


        function resetButton(){
            {{#idPatient}}
                $("#annuler-rdv").data("status", "ANNULER");
            {{/idPatient}}
            {{#idMedecin}}
                $("#annuler-rdv").data("status", "REFUSER");
            {{/idMedecin}}

            $("#add-ord").removeClass("btn-outline-info");
            $("#add-ord").addClass("btn-outline-secondary").prop('disabled', true);

            $("#annuler-rdv, #delete-rdv").removeClass("btn-danger");
            $("#annuler-rdv, #delete-rdv").addClass("btn-secondary").prop('disabled', true);

            $("#validate").data("status", "ACCEPTER");
            $("#validate").removeClass("btn-success");
            $("#validate").addClass("btn-secondary").prop('disabled', true);
        }

        function setDateTime(val){
            var d = new Date(val);
            var date = d.getFullYear()+ "-" +(d.getMonth()+1>=10?(d.getMonth()+1):"0"+(d.getMonth()+1)+ "-" +(d.getDate()>=10?d.getDate():"0"+d.getDate()));
            var time = (d.getHours()>=10?d.getHours():"0"+d.getHours())+":"+(d.getMinutes()>=10?(d.getMinutes()):"0"+(d.getMinutes()));
            return {date: date,time: time};
        }

        function showSelected(){
            var container = $("#item-selected-container");
            container.children().remove();
            if(selectedMedoc.length){
                $("#item-search").prop("required", false);
                selectedMedoc.forEach(function(el,i){
                    $(`<span class="item-selected">
                        ${i+1}-${el.nomMedoc}
                        <button type="button" class="delete" data-id=${i}>
                            <span></span>
                        </button>
                    </span>`).appendTo(container);
                })
            } else {
                $("#item-search").prop("required", true);
            }
        }
    {{/userData}}
