$(document).ready(function(e) {
    let url = $("#main-medocs").data("url");
    var medocData = {};

    if(url !== "medicaments"){
        window.location.href = window.origin+'/login';
    }
    {{#userData}}

        getData();

        console.log("medocData", medocData);
        $(window).on("click", function(){
            if(!$(this).hasClass("table-row")){
                $("#edit-trigger").removeClass("btn-info").addClass("btn-secondary").prop('disabled', true);
                $("#delete-medoc").removeClass("btn-danger").addClass("btn-secondary").prop('disabled', true);
                $(".table-row").removeClass("selected");
            }
        })
        $(".modal-content").on("click", function (e) {e.stopPropagation();});
        $(".close, .hide-modal").on("click", function (e) {$('#exampleModalCenter').modal('hide');});

        $(document).on("click", ".table-row", function(e){
            e.stopPropagation();

            $(".table-row").removeClass("selected");
            $(this).addClass("selected");
            $("#delete-medoc").removeClass("btn-secondary").addClass("btn-danger").prop('disabled', false);
            $("#edit-trigger").removeClass("btn-secondary").addClass("btn-info").prop('disabled', false);
        });

        $("#delete-medoc").on("click", function(){
            var id = $(".table-row.selected").data("id");
            var option = {animation: true, autohide: true, delay: 800};
            $.ajax({
                url: "/medicaments/", 
                type: "DELETE",
                data: {idMedoc:id},
                cache: false,
                success: function(res){
                    $('.toast').toast(option)

                    //$(".toast").toast('show');
                    setTimeout(function(){
                        getData();
                    },500);
                },
                error:function(err){
                    getData();
                    console.log("An error occured!!", err);
                    //location.reload();
                }
            });
        });

        $("#add-trigger").on("click", function(e){
            e.stopPropagation();
            resetModal();
            $('#exampleModalCenter').modal('show');
            $("#exampleModalLongTitle").html("Ajouter Mdicament")

            $("#form-id[ajax=true]").prop("action", "/medicaments")
            $("#form-id[ajax=true]").prop("method", "POST")
        });
        $("#edit-trigger").on("click", function(e){
            e.stopPropagation();
            var id = $(".table-row.selected").data("id");
            var medoc = medocData[id];
            resetModal();

            $('#exampleModalCenter').modal('show');
            $("#exampleModalLongTitle").html("Editer Mdicament");


            $("#form-id[ajax=true]").prop("action", "/medicaments");
            $("#form-id[ajax=true]").prop("method", "PUT")
            $("#form-id[ajax=true] input, #form-id[ajax=true] textarea").each(function(i, input){
                $(this).val(medoc[$(this).attr("name")]);
            });
        });

        $("#form-id[ajax=true]").on("submit", function(e){
            e.preventDefault();

            $("#save-medoc").prop("disabled", true);
            $("#notification").removeClass("alert-danger").removeClass("alert-success").html(".").hide();

            var form_data = $(this).serialize();
            var form_url = $(this).attr("action");
            var form_method = $(this).attr("method");

            if(form_method === "PUT"){
                form_data = "idMedoc="+$(".table-row.selected").data("id")+"&"+form_data;
            }

            form_data.trim();
            console.log("data", form_data);

            if(this.checkValidity()){
                $.ajax({
                    url: form_url, 
                    type: form_method,      
                    data: form_data,     
                    cache: false,
                    success: function(res){                          
                        res = JSON.parse(res || "{}");
                        if(res.success){
                            $("#notification").addClass("alert-success").html(res.message).slideToggle("fast");
                            setTimeout(function(){
                                $('#exampleModalCenter').modal('hide')
                                setTimeout(function(){
                                    getData();
                                },500);
                            },3000);
                        } else {
                            $("#notification").addClass("alert-danger").html(res.message).slideToggle("fast");
                            $("#save-medoc").prop("disabled", false);
                        }
                    },
                    error:function(err){
                        getData();
                        console.log(err)
                    }
                });
            } else {
                $("#save-medoc").prop("disabled", false);
            }
        })

    /********** Functions ***********/
        function getData(){
            var id = $(".table-row.selected").data("id");
            var rows = [];

            $.ajax({
                url: "/medicaments/init/all", 
                type: "GET",     
                data: {key: "{{key}}"},
                cache: false,
                success: function(res){   
                    res = JSON.parse(res || "{}");
                    console.log("res list medocs", res);

                    if(res.success && res.data.length){
                        res.data.map(function(medoc, i){

                            medocData[medoc.idMedoc] = medoc;

                            var row =  $(`<tr class="table-row">
                                <td>${i+1}</td->
                                <td>${medoc.nomMedoc}</td>
                                <td>${medoc.pu}</td>
                                <td style="max-width:100px;">${medoc.descMedoc.length >40?medoc.descMedoc.slice(0,20)+"...":medoc.descMedoc}</td>
                            </tr>`);

                            row.data("id", medoc.idMedoc)

                            if(id == medoc.idMedoc){
                                row.addClass("selected");
                            }

                            rows.push(row);
                        });

                        $("tbody").html(rows);
                    } else {
                        $("tbody").html(`<tr>
                            <td colspan="7" class="text-center">Aucun Mdicament pour le moment !!!!  </td>
                        </tr>`);
                        console.log("Error : ", res.message)
                    }
                },
                error: function(err) {
                    console.log("err", err);
                }
            });
        }

        function resetModal() {
            $("#save-medoc").prop("disabled", false);

            $("#form-id[ajax=true]").trigger("reset");
            $("#form-id[ajax=true]").removeClass("was-validated");

            $("#notification").removeClass("alert-danger").removeClass("alert-success").html(".").hide();
        }
    {{/userData}}
});

