$(document).ready(function(e) {
    let url = $("#main-medocs").data("url");
    var ordData = {};

    if(url !== "ordonnance"){
        window.location.href = window.origin+'/login';
    }
    {{#userData}}

        getData();

        $(document).on("click", function(){
                $("#show-detail").removeClass("btn-info").addClass("btn-secondary").prop('disabled', true);
                $(".table-row").removeClass("selected");

        })
        $(document).on("click", ".table-row", function(e){
            e.stopPropagation();
            $(".table-row").removeClass("selected");
            $(this).addClass("selected");
            $("#show-detail").removeClass("btn-secondary").addClass("btn-info").prop('disabled', false);
        });
        $(".modal-content").on("click", function (e) {e.stopPropagation();});
         $(".close, .hide-modal").on("click", function (e) {$('#exampleModalCenter').modal('hide');});

        $("#show-detail").on("click", function(e){
            var id = $(".table-row.selected").data("id");
            var ord = ordData[id];

             e.stopPropagation();
             $("#date-ord").text(setDateTime(ord.date).date);
            $('#exampleModalCenter').modal('show');

            $(".patient-info").html(`<div><label>Patient : </label><span> ${ord.nomPatient} ${ord.prenomPatient}</span></div>
                <div><label>Address : </label><span> ${ord.address}</span></div>
                <div class="position-relative"><label>Date de Naissance : </label><span> ${setDateTime(ord.dateNaissance)?.date}</span>
                    <span class="position-absolute" style="right:20px; bottom:0;"><label>Sexe : </label><span> ${ord.sexe}</span></span>
                </div>`)

            $(".medecin-info").html(`<div class="col-md-7 nomMedecin"><label>Medecin :</label> <span> ${ord.nomMedecin} ${ord.prenomMedecin}</span> </div>
                <div class="col-md-5 spc"><label>Spcialit :</label> <span> ${ord.specialite}</span> </div>
                <div class="col-md-7 numtel"><label>Numro :</label> <span> ${ord.numTel}</span> </div>
                <div class="col-md-5 email"><label>Email :</label> <span> ${ord.emailMedecin}</span> </div>`);

            $.ajax({
                url: "/ordonnance/detail", 
                type: "GET",
                data: {key:"{{key}}", idOrd: id, medocs: ord.medocs },
                cache: false,
                success: function(res){
                    res = JSON.parse(res || "{}");
                    console.log("res ord detail", res)
                    if(res.success && res.data.length){

                        console.log("response", res);
                        $(".ord-detail").children().remove();
                        res.data.forEach(function(el, i){
                            //var marker = 
                            var row = $(`
                                <div class="col-md-4 mb-3"><strong>${el.nomMedoc}</strong> <br> (PU: ${el.pu} FCFA)</div>
                                <div class="col-md-8 mb-3" style="white-space: pre-wrap;" >${ord.descOrd.split("\n")[i]}</div>
                            `).appendTo($(".ord-detail"));
                        });

                    } else {
                        console.log("wtf", res)

                    }

                },
                error: function(err){
                    console.log("An error occured !!", err);
                }
            });
        });

        $("#print-ord").on("click", function(e){
            printDiv();
        })

    /********** Functions ***********/
        function getData(){
            var rows = [];
            var id = $(".table-row.selected").data("id");
            $.ajax({
                url: "/ordonnance/init/all", 
                type: "GET",     
                data: {key: "{{key}}"},
                cache: false,
                success: function(res){   
                    res = JSON.parse(res || "{}");
                    console.log("res list ordonnances", res);

                    if(res.success && res.data.length){
                        res.data.map(function(ord, i){

                            ordData[ord.idOrd] = ord;

                            var dateparse = setDateTime(ord.date)

                            var row =  $(`<tr class="table-row">
                                <td>${i+1}</td>
                                <td>${ord.nomMedecin}</td>
                                <td>${ord.specialite}</td>`+

                                {{#idAdmin}}
                                    (ord.nomPatient? `<td>${ord.nomPatient}</td>`:"")+
                                {{/idAdmin}}

                                `<td>${dateparse.date}</td>
                                <td style="max-width:100px;">${ord.descOrd.length >40?ord.descOrd.slice(0,20)+"...":ord.descOrd}</td>
                            </tr>`);

                            row.data("id", ord.idOrd);
                            row.data("data", ord);

                            if(id == ord.idOrd){
                                row.addClass("selected");
                            }
                            rows.push(row)
                        });
                        $("tbody.main").html(rows);
                    } else {
                        $("tbody.main").html(`<tr>
                                <td colspan="7" class="text-center">Aucun Ordonnance pour le moment !!</td>
                            </tr>`);

                        console.log("Error : ", res.message)
                    }
                },
                error:function(err){
                    console.log("err", err);
                }
            });
        }

        function setDateTime(val){
            var d = new Date(val);
            var date = d.getFullYear()+ "-" +(d.getMonth()+1>=10?(d.getMonth()+1):"0"+(d.getMonth()+1)+ "-" +(d.getDate()>=10?d.getDate():"0"+d.getDate()));
            var time = (d.getHours()>=10?d.getHours():"0"+d.getHours())+":"+(d.getMinutes()>=10?(d.getMinutes()):"0"+(d.getMinutes()));
            return {date: date,time: time};
        }
        function printDiv() {
            var divContents = document.getElementById("target-print").innerHTML;
            var a = window.open('', '', 'height=800, width=1000');
            a.document.write('<html>');
            a.document.write('<head>');
            a.document.write('<title>ordonnance-MediRdv</title>');
            a.document.write('<link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@4.6.1/dist/css/bootstrap.min.css" integrity="sha384-zCbKRCUGaJDkqS1kPbPd7TveP5iyJE0EjAuZQTgFLD2ylzuqKfdKlfG/eSrtxUkn" crossorigin="anonymous">');
            a.document.write('<style>');
            a.document.write(`{{{payload.style}}}`);
            a.document.write('</style>');
            a.document.write('</head>');
            a.document.write('<body class="pt-5">');
            a.document.write('<div class="w-75 m-auto">');
            a.document.write('<h1 class="text-center mb-5" >Ordonnance </h1>')
            a.document.write(divContents);
            a.document.write('</div>')
            a.document.write('</body></html>');
            a.document.close();
            a.print();
            setTimeout(function(){ a.close()}, 5000);

        }
    {{/userData}}
});

