    SELECT idRdv, dateTime, active, status, specialite, emailMedecin, nomMedecin, NOW()
        FROM Rdv
        INNER JOIN Medecin ON Rdv.idMedecin = Medecin.idMedecin
        WHERE Rdv.idPatient={{userData.idPatient}}
        AND datetime >= NOW() - INTERVAL 5 DAY
        ORDER BY dateTime DESC;
{{/userData.idPatient}}

{{#userData.idMedecin}}
    SELECT idRdv,Rdv.idPatient, dateTime, active, status, emailPatient, nomPatient, NOW(), Patient.sexe
        FROM Rdv
        INNER JOIN Patient ON Rdv.idPatient = Patient.idPatient
        WHERE Rdv.idMedecin={{userData.idMedecin}}
        AND datetime >= NOW() - INTERVAL 5 DAY
        ORDER BY dateTime DESC;
{{/userData.idMedecin}}

