func:
//msg.emailPayload = {sender: msg.userData.emailAdmin, emailDest: [msg.payload.emailMedecin, msg.payload.emailPatient]}
//msg.to = msg.payload.emailPatient;

if(msg.userData.user == "Patient"){

    msg.payload.recipient = msg.payload.emailMedecin;

    if(msg.payload.oldStatus == "VALIDER" && msg.payload.status == "ANNULER" ){
        msg.payload.subject = "MediRdv Alerte: Annulation de rendez-vous"
        msg.payload.body_text = "Salut Dr "+msg.payload.nomMedecin+","+
            "\n\nVotre rendez-vous prvu le "+ setDateTime(msg.payload.dateTime).date +
            "  "+setDateTime(msg.payload.dateTime).time+" avec le patient "+msg.payload.nomPatient+
            " a t annul"+
            "\n\n\nCordialement,"+
            "\nL'quipe MediRdv";
    }

} else if(msg.userData.user == "Medecin") {

    msg.payload.recipient = msg.payload.emailPatient;

    if(msg.payload.oldStatus == "ATTENTE" && msg.payload.status == "ACCEPTER" ){

        msg.payload.subject = "MediRdv Alerte: Validation de votre rendez-vous"
        msg.payload.body_text = "Salut "+msg.payload.nomPatient+","+
            "\n\nVotre rendez-vous prvu le "+ setDateTime(msg.payload.dateTime).date +
            "  "+setDateTime(msg.payload.dateTime).time+" avec le Medcin "+msg.userData.nomMedecin+
            " a bien t accepte."+
            "\nVous tes attendu  la date dite dans notre clinique pour passer votre consultation."+
            "\n\nCordialement,"+
            "\nL'quipe MediRdv"; 

    } else if(msg.payload.oldStatus == "ATTENTE" && msg.payload.status == "REFUSER" ){

        msg.payload.subject = "MediRdv Alerte: Annulation de rendez-vous"
        msg.payload.body_text = "Salut "+msg.payload.nomPatient+","+
            "\n\nVotre rendez-vous prvu le "+ setDateTime(msg.payload.dateTime).date +
            "  "+setDateTime(msg.payload.dateTime).time+" avec le Medcin "+msg.payload.nomMedecin+
            " a malheureusement t annul."+
            "\nNe vous inquitez pas car vous pouvez encore demander un autre rendez-vous."+
            "\n\n\nCordialement,"+
            "\nL'quipe MediRdv";
    }
} else if(msg.userData.user == "Admin"){

    msg.payload.recipient = msg.payload.emailPatient;

    if((msg.payload.oldStatus == "ATTENTE" && msg.payload.status == "ANNULER" ) || 
        (msg.payload.oldStatus == "ACCEPTR" && msg.payload.status == "ANNULER") ){

        msg.payload.subject = "MediRdv Alerte: Annulation de votre rendez-vous"
        msg.payload.body_text = "Salut "+msg.payload.nomPatient+","+
            "\n\nVotre rendez-vous prvu le "+ setDateTime(msg.payload.dateTime).date +
            "  "+setDateTime(msg.payload.dateTime).time+" avec le Medcin "+msg.payload.nomMedecin+
            " a t annul pour des raisons inattendus."+

            "\nNous sommes dsol pour ce dsagrment!"+

            "\nNe vous inquitez pas car vous pouvez encore demander un autre rendez-vous."+

            "\n\nCordialement,"+
            "\nL'quipe MediRdv"; 

    }
}

return msg;

function setDateTime(val){
    var d = new Date(val);
    var date = d.getFullYear()+ "-" +(d.getMonth()+1>=10?(d.getMonth()+1):"0"+(d.getMonth()+1)+ "-" +(d.getDate()>=10?d.getDate():"0"+d.getDate()));
    var time = (d.getHours()>=10?d.getHours():"0"+d.getHours())+":"+(d.getMinutes()>=10?(d.getMinutes()):"0"+(d.getMinutes()));
    return {date: date,time: time};
}

